import React, { Component } from 'react';

class Search extends Component {


  render() {


    return (
      <div id="search-input">
        <input
            id="search-input"
            autoComplete="off"
            type="text"
            placeholder='Search by Location...'
            />
            {
              this.props.locations.lenght > 5 ?
              <h1>hello</h1>
              :
              <h1>poop</h1>
            }
      </div>
    );
  }

}

export default Search;
